import React, { Component } from "react";
import { Link } from 'react-router-dom';


class NewProductItem extends Component {
	render() {
		return (
			<div class="col-12 col-md-3 col-sm-6">
				<figure class="card card-product p-2 pb-3 my-3">
					<div class="container-float">
						<span class="badge badge-danger float-right p-2"> NEW </span>
					</div>
					<figcaption class="info-wrap pt-3">
						<Link to='/detailproduct' class="text-decoration-none">
							<div class="img-wrap">
								<img src={require("../../images/tuner.png")} height="150px" />
							</div>
							<p class="title mt-2" style={{ fontWeight: 600 }}>
								namaProduk</p></Link>
								<div class='container-fluid'>
							<div class='row mx-auto'>
								<p >Rp 00000</p>
								<p>nama penjual</p>
							</div>
							<div class="action-wrap">
								<a href="#" class="btn btn-info"><i class="fas fa-cart-plus"></i> Add to Cart </a>
							</div>
						</div>
					</figcaption>
				</figure>
			</div>
		);
	}
}

export default NewProductItem;
